import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, question, questions, questionId,props }){

   //const q = (id) => getQuestionId(2);

    const q = getQuestionId(2);

    const qt = ((id) => {
        getQuestionId(id)
    })

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
            <p>{qt.title}</p>


        </Paper>
    )
}

export default Question;
